import React, { Component } from "react";
import { Col } from "react-bootstrap";
import "./Footer.css";
class Footer extends Component {
  render() {
    return (
      <div className="footer fixed-down">
        <Col md={4}>
          <h3
            style={{
              marginLeft: `10%`,
              fontSize: `40px`,
              fontWeight: `bolder`,
              fontStyle: `italic`,
              color: "white",
            }}
          >
            Blue
            <span style={{ color: `orange`, fontFamily: `sans-serif` }}>
              Let
            </span>
          </h3>
        </Col>

        <Col md={4}>
          <p className="para">&copy; 2021 All Rights Reserved, Adom Clinic.</p>
        </Col>

        <Col md={4}></Col>
      </div>
    );
  }
}

export default Footer;
